import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  state = {
    news: []
  }

  handleFetch = () => {
    url="https://api.nytimes.com/svc/topstories/v2/travel.json?api-key=[J3xWBLkAx9AAy8xO1BVmOIPG0CoeVWA3]"
    fetch(url)
    .then(resp=>resp.json())
    .then(data=>{
      this.setState({
        news: data
      })
    })
  }

  render(){
    console.log(data)
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}
}

export default App;
